import { Movie } from 'type/movie';
import './styles.css';

type Props = {
  movie: Movie[];
};

const MovieCard = ({ movie }: Props) => {
  return (
    <>
      {movie && (
        <div key={movie.id} className="movie-card-container">
          <img src={movie.imgUrl} alt={movie.title} />
          <h1>{movie.title}</h1>
          <span>{movie.year}</span>
          <p>{movie.subTitle}</p>
        </div>
      )}
    </>
  );
};

export default MovieCard;
